import React from 'react';
import minecraft from "../images/minecraft.png";
import image_game from "../images/image_game.png";

const Home = () => {
    return (
        <div>
            <img src = {minecraft} alt = " image minecraft" />
            <img src = {image_game} alt = "image game boy color" />
        </div>
    );
};

export default Home;
